					["custom"] = "aura_env.updateInterval = 0.05\naura_env.lastUpdate = GetTime()\naura_env.targetWipeInterval = 5\n\naura_env.showCooldownRing = true\naura_env.invertCooldownRing = false\naura_env.showRangeHighlight = true\n\naura_env.enabledToggle = \"ALT-SHIFT-T\"\naura_env.cooldownsToggle = \"ALT-SHIFT-R\"\n\nWA_MiniHekili_Enh_Enabled = WeakAurasSaved.displays[aura_env.id].hekiliEnabled == nil and true or WeakAurasSaved.displays[aura_env.id].hekiliEnabled\n\nWA_MiniHekili_Enh_CDs = WeakAurasSaved.displays[aura_env.id].hekiliCooldowns == nil and false or WeakAurasSaved.displays[aura_env.id].hekiliCooldowns\n\naura_env.keyhandler = aura_env.keyhandler or CreateFrame(\"Button\", aura_env.id..\"_Keyhandler\", UIParent)\naura_env.keyhandler.parent = aura_env\naura_env.keyhandler:RegisterForClicks(\"AnyDown\")\naura_env.keyhandler:SetScript(\"OnClick\", function (self, button, down)\n        if button == \"Cooldowns\" then\n            WA_MiniHekili_Enh_CDs = not WA_MiniHekili_Enh_CDs\n            print(\"|cFF00FFFFMini-Hekili Cooldowns: \" .. ( WA_MiniHekili_Enh_CDs and \"|cFF00FF00ENABLED|r\" or \"|cFFFF0000DISABLED|r\" ) )\n        elseif button == \"Enabled\" then\n            WA_MiniHekili_Enh_Enabled = not WA_MiniHekili_Enh_Enabled\n            print(\"|cFF00FFFFMini-Hekili: \" .. ( WA_MiniHekili_Enh_Enabled and \"|cFF00FF00ENABLED|r\" or \"|cFFFF0000DISABLED|r\" ) )\n        end\n        \n        WeakAurasSaved.displays[self.parent.id].hekiliEnabled = WA_MiniHekili_Enh_Enabled\n        WeakAurasSaved.displays[self.parent.id].hekiliCooldowns = WA_MiniHekili_Enh_CDs\nend)\n\nfunction aura_env.setupBinds()\n    \n    HekiliTempSetupBinds = HekiliTempSetupBinds or aura_env\n    \n    if InCombatLockdown() then\n        C_Timer.After( 5, HekiliTempSetupBinds.setupBinds )\n        return\n    end\n    \n    ClearOverrideBindings( HekiliTempSetupBinds.keyhandler )\n    SetOverrideBindingClick( HekiliTempSetupBinds.keyhandler, true, HekiliTempSetupBinds.enabledToggle, HekiliTempSetupBinds.id..\"_Keyhandler\", \"Enabled\" )\n    SetOverrideBindingClick( HekiliTempSetupBinds.keyhandler, true, HekiliTempSetupBinds.cooldownsToggle, HekiliTempSetupBinds.id..\"_Keyhandler\", \"Cooldowns\" )\n    \n    C_Timer.After( 3, function ()\n            \n            print(\"|cFF00FFFFMini-Hekili|r:  Keybinds are now active.\")\n            print(\"Enable/Disable - |cFFFFD100\" .. HekiliTempSetupBinds.enabledToggle .. \"|r.\")\n            print(\"Toggle Cooldowns - |cFFFFD100\" .. HekiliTempSetupBinds.cooldownsToggle .. \"|r.\")\n            print(\"You can *carefully* change these keybinds in the \" .. HekiliTempSetupBinds.id .. \" WeakAura on the Actions Tab, On Init, Expand Text Editor and see lines 9 and 10.\" )\n            \n            HekiliTempSetupBinds = nil\n    end )\n    \n    \nend\n\naura_env.setupBinds()\n\naura_env.recommended = 204945\naura_env.timeToReady = 999\naura_env.timeOffset = 0\n\naura_env.targets = {}\naura_env.targetCount = 0\n\naura_env.talents = {\n    windsong = { 1, 1, 1 },\n    hot_hand = { 1, 2, 1 },\n    boulderfist = { 1, 3, 1 },\n    \n    rainfall = { 2, 1, 1 },\n    feral_lunge = { 2, 2, 1 },\n    wind_rush_totem = { 2, 3, 1 },\n    \n    lightning_surge_totem = { 3, 1, 1 },\n    earthgrab_totem = { 3, 2, 1 },\n    voodoo_totem = { 3, 3, 1 },\n    \n    lightning_shield = { 4, 1, 1 },\n    ancestral_swiftness = { 4, 2, 1 },\n    hailstorm = { 4, 3, 1 },\n    \n    tempest = {5, 1, 1 },\n    overcharge = { 5, 2, 1 },\n    empowered_stormlash = { 5, 3, 1 },\n    \n    crashing_storm = { 6, 1, 1 },\n    fury_of_air = { 6, 2, 1 },\n    sundering = {6, 3, 1 },\n    \n    ascendance = { 7, 1, 1 },\n    landslide = { 7, 2, 1 },\n    earthen_spike = { 7, 3, 1 }\n}\n\naura_env.talented = {}\n\naura_env.abilities = {\n    ascendance = 114051,\n    boulderfist = 201897,\n    crash_lightning = 187874,\n    doom_winds = 204945,\n    earthen_spike = 188089,\n    feral_spirit = 51533,\n    flametongue = 193796,\n    frostbrand = 196834,\n    fury_of_air = 197211,\n    healing_surge = 188070,\n    lava_lash = 60103,\n    lightning_bolt = 187837,\n    lightning_shield = 192106,\n    rainfall = 215864,\n    rockbiter = 193786,\n    stormstrike = 17364,\n    sundering = 197214,\n    windsong = 201898\n}\n\naura_env.treatAsCD = {\n    ascendance = true,\n    feral_spirit = true,\n}\n\n\naura_env.chargedAbilities = {\n    boulderfist = 201897\n}\n\naura_env.abilityNames = {}\n\nfor k,v in pairs( aura_env.abilities ) do\n    aura_env.abilityNames[ v ] = GetSpellInfo( v )\nend\n\naura_env.cooldowns = {}\naura_env.charges = {}\naura_env.chargeTime = {}\naura_env.chargesMax = {}\n\naura_env.buffs = {\n    ascendance= 114051,\n    boulderfist = 218825,\n    crash_lightning = 187874,\n    doom_winds = 204945,\n    flametongue = 194084,\n    frostbrand = 196834,\n    fury_of_air = 197211,\n    hot_hand = 215785,\n    landslide = 202004,\n    lightning_shield = 192109,\n    rainfall = 215864,\n    stormbringer = 201845,\n    windsong = 201898\n}\n\naura_env.buffNames = {}\n\nfor k,v in pairs( aura_env.buffs ) do\n    aura_env.buffNames[ v ] = GetSpellInfo( v )\nend\n\naura_env.buffRemains = {}\n\naura_env.debuffs = {\n    earthen_spike = 188089,\n    sundering = 197214,\n    stormbringer = 201846\n}\n\naura_env.debuffNames = {}\n\nfor k,v in pairs( aura_env.debuffs ) do\n    aura_env.debuffNames[ v ] = GetSpellInfo( v )\nend\n\naura_env.debuffRemains = {}\n\nfunction aura_env.rec( spell )\n    aura_env.recommended = aura_env.abilities[ spell ]\n    aura_env.timeToReady = aura_env.cooldowns[ spell ]\n    \nend\n\nfunction aura_env.ready( spell )\n    if aura_env.talents[ spell ] and not aura_env.talented[ spell ] then return false end\n    if aura_env.cooldowns[ spell ] + 0.1 < aura_env.timeToReady then\n        aura_env.timeOffset = aura_env.cooldowns[ spell ] + 0.1 -- build in a 0.1s buffer\n        return true\n    end\n    return false\nend\n\nfunction aura_env.buffRem( buff )\n    return max( 0, aura_env.buffRemains[ buff ] - aura_env.timeOffset )\nend\n\nfunction aura_env.debuffRem( debuff )\n    return max( 0, aura_env.debuffRemains[ debuff ] - aura_env.timeOffset )\nend\n\n\nfunction aura_env.buffUp( buff )\n    return max( 0, aura_env.buffRemains[ buff ] - aura_env.timeOffset ) > 0\nend\n\nfunction aura_env.debuffUp( debuff )\n    return max( 0, aura_env.debuffRemains[ debuff ] - aura_env.timeOffset ) > 0\nend\n\n\nfunction aura_env.chargeCt( spell )\n    local rounded = tonumber( format( \"%.1f\", aura_env.timeOffset ) ) - 0.1\n    \n    return min( aura_env.chargesMax[ spell ], aura_env.charges[ spell ] + rounded / aura_env.chargeTime[ spell ] )\nend\n\n\nfunction aura_env.cdLeft( spell )\n    return max( 0, aura_env.cooldowns[ spell ] - aura_env.timeOffset )\nend\n\nfunction aura_env.try( spell, conditions )\n    if not aura_env.ready( spell ) then return end\n    if not conditions then return end\n    \n    aura_env.rec( spell )\nend\n\n\n\n\nfunction aura_env.num_targets()\n    return aura_env.targetCount\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
