				["customIcon"] = "function ()\n    return GetSpellTexture( aura_env.recommended )\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
				["customTexture"] = "\n\n",
				["custom_hide"] = "timed",
				["check"] = "update",
				["debuffType"] = "HELPFUL",
				["unevent"] = "auto",
				["type"] = "custom",
				["custom"] = "-- UNIT_POWER_FREQUENT, SPELL_UPDATE_COOLDOWN, SPELL_UPDATE_CHARGES, PLAYER_TARGET_CHANGED, UNIT_SPELLCAST_SUCCEEDED\n\nfunction ()\n    \n    if not WA_MiniHekili_Enh_Enabled or UnitOnTaxi(\"player\") then\n        return false\n    end\n    \n    local now = GetTime()\n    \n    if now < aura_env.lastUpdate + aura_env.updateInterval then\n        return true\n    end\n    \n    aura_env.lastUpdate = now\n    \n    local targets = aura_env.targets\n    local talentList = aura_env.talents\n    local talented = aura_env.talented\n    local abilities = aura_env.abilities\n    local abilityNames = aura_env.abilityNames\n    local cooldowns = aura_env.cooldowns\n    local charges = aura_env.charges\n    local chargedAbilities = aura_env.chargedAbilities\n    local chargeTime = aura_env.chargeTime\n    local chargesMax = aura_env.chargesMax\n    local buffList = aura_env.buffs\n    local buffNames = aura_env.buffNames\n    local buffRemains = aura_env.buffRemains\n    local debuffList = aura_env.debuffs\n    local debuffNames = aura_env.debuffNames\n    local debuffRemains = aura_env.debuffRemains\n    local buffRem = aura_env.buffRem\n    local buffUp = aura_env.buffUp\n    local debuffRem = aura_env.debuffRem\n    local debuffUp = aura_env.debuffUp\n    local chargeCt = aura_env.chargeCt\n    local cdLeft = aura_env.cdLeft\n    local treatAsCD = aura_env.treatAsCD\n    \n    local try = aura_env.try\n    local num_targets = aura_env.num_targets\n    \n    for k,v in pairs( targets ) do\n        if now - v > aura_env.targetWipeInterval then\n            targets[k] = nil\n            aura_env.targetCount = max(0, aura_env.targetCount - 1)\n        end\n    end\n    \n    local gcdStart, gcdDuration = GetSpellCooldown(61304)\n    local gcd = gcdStart + gcdDuration\n    \n    -- if GCD is active, we'll just advance to the end of the GCD.\n    now = max( now, gcd )\n    \n    -- if the GCD isn't active, calculate what the GCD should be.\n    if gcdDuration == 0 then\n        gcdDuration = max( 1, 1.5 / ( 1 + ( GetHaste() / 100 ) ) )\n    end\n    \n    -- Grab resource info.\n    local maelstrom = UnitPower( \"player\", SPELL_POWER_MAELSTROM)\n    local maelstromMax = UnitPowerMax(\" player\", SPELL_POWER_MAELSTROM)\n    local maelstromDeficit = maelstromMax - maelstrom\n    \n    \n    -- Get active talents.\n    for k,v in pairs( talentList ) do\n        talented[ k ] = select(4, GetTalentInfo( unpack( v ) ) )\n    end\n    \n    -- Grab ability CDs.\n    for k,v in pairs( abilities ) do\n        local start, duration = GetSpellCooldown(v)\n        cooldowns[ k ] = IsUsableSpell(v) and max( 0, start + duration - now ) or 999\n        if treatAsCD[ k ] and not WA_MiniHekili_Enh_CDs then cooldowns[ k ] = 999 end\n    end\n    \n    local artifact = IsEquippedItem(128819) \n    if not artifact then cooldowns.doom_winds = 999 end\n    if talented.boulderfist then cooldowns.rockbiter = 999 end    \n    \n    -- Check # of charges.\n    for k,v in pairs( chargedAbilities ) do\n        local c, maxCharges, start, duration = GetSpellCharges(v)\n        \n        charges[ k ] = min( maxCharges, c + ( max(0, 1 - ( start + duration - now) / duration ) ) )\n        chargeTime[ k ] = duration\n        chargesMax[ k ] = maxCharges\n        \n        if treatAsCD[ k ] and not WA_MiniHkili_Enh_CDs then charges[ k ] = 0 end\n    end  \n    \n    -- Check if buffs are up.\n    for k,v in pairs( buffList ) do\n        local _, _, _, _, _, _, expires = UnitBuff(\"player\", buffNames[ v ] )\n        \n        buffRemains[ k ] = 0\n        \n        if expires then\n            if expires == 0 then\n                buffRemains[ k ] = 10 -- No real duration, i.e. Fury of Air.\n            else\n                buffRemains[ k ] = expires - now\n            end\n        end\n        \n    end\n    \n    -- Check if debuffs are up.\n    for k,v in pairs( debuffList ) do\n        local _, _, _, _, _, _, expires = UnitDebuff(\"target\", debuffNames[ v ], nil, 'PLAYER' )\n        \n        debuffRemains[ k ] = expires and expires - now or 0\n    end\n    \n    aura_env.lastRec = aura_env.recommended\n    aura_env.recommended = 0\n    aura_env.timeToReady = 30\n    \n    local rec = aura_env.rec\n    local ready = aura_env.ready\n    \n    if ready( 'lightning_shield' ) and (  not buffUp( 'lightning_shield' ) ) then rec( 'lightning_shield' ) end\n    if ready( 'feral_spirit' ) and ( true ) then rec( 'feral_spirit' ) end\n    if ready( 'boulderfist' ) and ( buffRem( 'boulderfist' )<gcdDuration or chargeCt( 'boulderfist' ) >1.75 ) then rec( 'boulderfist' ) end\n    if ready( 'frostbrand' ) and ( talented.hailstorm and buffRem( 'frostbrand' )<gcdDuration ) then rec( 'frostbrand' ) end\n    if ready( 'flametongue' ) and ( buffRem( 'flametongue' )<gcdDuration ) then rec( 'flametongue' ) end\n    if ready( 'windsong' ) and ( true ) then rec( 'windsong' ) end\n    if ready( 'ascendance' ) and ( true ) then rec( 'ascendance' ) end\n    if ready( 'fury_of_air' ) and (  not buffUp( 'fury_of_air' ) ) then rec( 'fury_of_air' ) end\n    if ready( 'doom_winds' ) and ( true ) then rec( 'doom_winds' ) end\n    if ready( 'crash_lightning' ) and ( num_targets()>=3 ) then rec( 'crash_lightning' ) end\n    if ready( 'stormstrike' ) and ( true ) then rec( 'stormstrike' ) end\n    if ready( 'frostbrand' ) and ( talented.hailstorm and buffRem( 'frostbrand' )<4.8 ) then rec( 'frostbrand' ) end\n    if ready( 'flametongue' ) and ( buffRem( 'flametongue' )<4.8 ) then rec( 'flametongue' ) end\n    if ready( 'lightning_bolt' ) and ( talented.overcharge and maelstrom>=60 ) then rec( 'lightning_bolt' ) end\n    if ready( 'lava_lash' ) and ( buffUp( 'hot_hand' ) ) then rec( 'lava_lash' ) end\n    if ready( 'earthen_spike' ) and ( true ) then rec( 'earthen_spike' ) end\n    if ready( 'crash_lightning' ) and ( num_targets()>1 or talented.crashing_storm or cdLeft( 'feral_spirit' ) > 110 and cdLeft( 'feral_spirit' ) < 999 ) then rec( 'crash_lightning' ) end\n    if ready( 'sundering' ) and ( true ) then rec( 'sundering' ) end\n    if ready( 'lava_lash' ) and ( maelstrom>=90 ) then rec( 'lava_lash' ) end\n    if ready( 'rockbiter' ) and ( true ) then rec( 'rockbiter' ) end\n    if ready( 'flametongue' ) and ( true ) then rec( 'flametongue' ) end\n    if ready( 'boulderfist' ) and ( true ) then rec( 'boulderfist' ) end\n    \n    \n    if aura_env.timeToReady < 5 then\n        if aura_env.showCooldownRing then\n            local start, duration = GetSpellCooldown( aura_env.recommended )\n            \n            if not start or start == 0 then\n                start, duration = GetSpellCooldown( 61304 )\n            end\n            \n            WeakAuras.regions[aura_env.id].region.cooldown:SetReverse(aura_env.invertCooldownRing)\n            WeakAuras.regions[aura_env.id].region.cooldown:SetCooldown(start, duration)\n        end\n        \n        if aura_env.showRangeHighlight then\n            local rangespell = aura_env.recommended ~= abilities.boulderfist and aura_env.recommended or abilities.flametongue\n            local range = aura_env.recommended == 0 and 0 or  IsSpellInRange( abilityNames[ rangespell ] )\n            \n            if range == 0 then \n                WeakAuras.regions[aura_env.id].region.icon:SetDesaturated(true)\n                WeakAuras.regions[aura_env.id].region:Color(1, 0, 0, 1)\n            else\n                WeakAuras.regions[aura_env.id].region.icon:SetDesaturated(false)\n                WeakAuras.regions[aura_env.id].region:Color(1, 1, 1, 1) \n            end\n        end\n    else\n        WeakAuras.regions[aura_env.id].region.icon:SetDesaturated(false)\n        WeakAuras.regions[aura_env.id].region.cooldown:SetCooldown(0,0)\n        WeakAuras.regions[aura_env.id].region:Color(1,1,1,1)\n        return false\n    end\n    \n    \n    return true\n    \nend",
