			["displayText"] = "%c",
			["customText"] = "function()\n    local E_global_overflow\n    local curASP = UnitPower('player',8)\n    local Predict_AP = 0\n    local Predict_non_fill = 0\n    local ca_mod = 1\n    local bota_mod = 1\n    local SpellCast = UnitCastingInfo('player')\n    local BOTA = UnitBuff('player', aura_env.bota_spell, false, \"PLAYER\")\n    \n    local CA = select(4, GetTalentInfo(5, 2, 1)) -- says if Incarnation is selected or not\n    \n    if CA then CA = aura_env.inc else CA = aura_env.ca end\n    \n    local BUFF = UnitBuff('player', CA, false, \"PLAYER\")\n    \n    if select(1,BOTA) == aura_env.bota_spell then\n        bota_mod = 1.4\n    end\n    if select(1,SpellCast) == aura_env.lunarStrike  then\n        Predict_AP = 10\n    elseif select(1,SpellCast) == aura_env.solarWrath then\n        Predict_AP = 6\n    elseif select(1,SpellCast) == aura_env.healingTouch then -- Touch of the Stars\n        if GetPvpTalentInfo(5,1,1) == true then\n            Predict_non_fill = 15\n        else\n            Predict_non_fill = 0\n        end\n    elseif select(1,SpellCast) == aura_env.newMoon then -- New Moon\n        Predict_non_fill = 10\n    elseif select(1,SpellCast) == aura_env.halfMoon then -- Half Moon\n        Predict_non_fill = 20\n    elseif select(1,SpellCast) == aura_env.fullMoon then -- Full Moon\n        Predict_non_fill = 40\n    elseif select(1,SpellCast) == aura_env.stellarFlare then -- Stellar Flare\n        Predict_non_fill = (-15)\n    end\n    \n    \n    if not BUFF == false then\n        ca_mod = 1.5\n        if not UnitCastingInfo('player') == false then -- casting spells\n            if select(7,UnitBuff('player', CA, false, \"PLAYER\"))-GetTime() < select(6,UnitCastingInfo('player'))/1000-GetTime() then -- if our buff expires \n                ca_mod = 1\n            end\n        end\n    end\n    \n    E_global = abs(curASP)+Predict_non_fill+(Predict_AP*ca_mod*bota_mod) or 0\n    \n    \n    if E_global >= 100 then\n        E_global_overflow = E_global\n        \n        \n        if E_global_overflow > 0 then\n            E_global = 100\n        end\n        \n    end\n    \n    if E_global <= 0 then\n        E_global = 0\n    end\n    \n    if aura_env.predict == false then\n        return string.format(\"%.0f\", curASP)\n    end\n    \n    if E_global_overflow ~= nil and E_global_overflow >= 101 then\n        if aura_env.decimal == false then\n            E_global_overflow = math.floor(E_global_overflow)\n        end\n        return (\"|cffFF0000*\"..E_global_overflow..\"*|r\")\n    else\n        if aura_env.decimal == true then\n            return E_global\n        else\n            return string.format(\"%.0f\",E_global)\n        end\n    end\n    \n    \nend",
