ch stack is worth\nWA_PLAYER_AURAS_TEDEXPIRES = 0;\nWA_PLAYER_AURAS_TEDDURATION = 0;\nWA_PLAYER_AURAS_TEDSTACKS = 0;\n--oneth's intuition\nWA_PLAYER_AURAS_ONETHS_SS = false; --free star surge\nWA_PLAYER_AURAS_ONETHS_SF = false; --free star fall\n\nfunction WA_DB_ResetTalentInfo()\n    \n    WA_T15_NAME = nil\n    WA_T15_ICON = nil\n    WA_T30_NAME = nil\n    WA_T30_ICON = nil\n    WA_T75_NAME = nil\n    WA_T75_ICON = nil\n    \n    WA_PLAYER_TALENTS_15_SPELLID = 0\n    WA_PLAYER_TALENTS_30_SPELLID = 0\n    WA_PLAYER_TALENTS_75_SPELLID = 0\n    \n    WA_SPELL_STELLARFLARE_DURATION = -1\n    WA_SPELL_STELLARFLARE_EXPIRES = -1  \n    \n    WA_PLAYER_TALENTS_FON = false\n    WA_PLAYER_TALENTS_WOE = false\n    WA_PLAYER_TALENTS_SL = false\n    WA_PLAYER_TALENTS_RENEWAL = false\n    WA_PLAYER_TALENTS_DISPLACER = false\n    WA_PLAYER_TALENTS_CHARGE = false\n    WA_PLAYER_TALENTS_STELLARFLARE = false\n    WA_PLAYER_TALENTS_INCARNATION = false\nend\n\nfunction WA_BD_CF_TalentChanges()\n    \n    local name, _, spellId = nil\n    \n    WA_DB_ResetTalentInfo()\n    \n    --check for stellar falre\n    name, _, spellId = select(4, GetTalentInfo(5,3,1))\n    \n    if name then\n        WA_T75_NAME, _, WA_T75_ICON = GetSpellInfo(spellId)\n        WA_PLAYER_TALENTS_75_SPELLID = spellId\n        WA_PLAYER_TALENTS_STELLARFLARE  = true\n    end\n    \n    --check for incarnation\n    name, _, spellId = select(4, GetTalentInfo(5,2,1))\n    \n    if name then\n        WA_T75_NAME, _, WA_T75_ICON = GetSpellInfo(spellId)\n        WA_PLAYER_TALENTS_75_SPELLID = spellId\n        WA_PLAYER_TALENTS_INCARNATION  = true\n    end\n    \n    --check for force of nature\n    name, _, spellId = select(4, GetTalentInfo(1,1,1))\n    \n    if name then\n        WA_PLAYER_TALENTS_15_SPELLID = spellId\n        WA_SPELL_FON_SPELLID = spellId\n        WA_PLAYER_TALENTS_FON  = true\n        WA_T15_NAME, _, WA_T15_ICON = GetSpellInfo(spellId)\n    end\n    \n    --check for warrior of elune\n    name, _, spellId = select(4, GetTalentInfo(1,2,1))\n    \n    WA_SPELL_WOE_SPELLID = spellId\n    \n    if name then\n        WA_PLAYER_TALENTS_15_SPELLID = spellId\n        WA_SPELL_WOE_SPELLID = spellId\n        WA_T15_NAME, _, WA_T15_ICON = GetSpellInfo(spellId)\n        WA_PLAYER_TALENTS_WOE  = true\n    end\n    \n    --check for star lord\n    name, _, spellId = select(4, GetTalentInfo(1,3,1))\n    \n    if name then\n        WA_PLAYER_TALENTS_15_SPELLID = spellId\n        WA_SPELL_SL_SPELLID = spellId\n        WA_PLAYER_TALENTS_SL  = true\n        WA_T15_NAME, _, WA_T15_ICON = GetSpellInfo(spellId)\n    end\n    \n    --check for Renewal\n    name, _, spellId = select(4, GetTalentInfo(2,1,1))\n    \n    if name then\n        WA_PLAYER_TALENTS_RENEWAL = true\n        WA_PLAYER_TALENTS_30_SPELLID = spellId\n        WA_T30_NAME, _, WA_T30_ICON = GetSpellInfo(spellId)\n    end\n    \n    --check for Displacer\n    name, _, spellId = select(4, GetTalentInfo(2,2,1))\n    \n    if name then\n        WA_PLAYER_TALENTS_DISPLACER = true\n        WA_PLAYER_TALENTS_30_SPELLID = spellId\n        WA_T30_NAME, _, WA_T30_ICON = GetSpellInfo(spellId)\n    end\n    \n    --check for Wild Charge\n    name, _, spellId = select(4, GetTalentInfo(2,3,1))\n    \n    if name then\n        WA_PLAYER_TALENTS_CHARGE = true\n        WA_PLAYER_TALENTS_30_SPELLID = spellId\n        WA_T30_NAME, _, WA_T30_ICON = GetSpellInfo(spellId)\n    end \n    \n    --check for Mighty Bash\n    name, _, spellId = select(4, GetTalentInfo(4,1,1))\n    \n    if name then\n        WA_PLAYER_TALENTS_MIGHTYBASH = true\n        WA_PLAYER_TALENTS_60_SPELLID = spellId\n        WA_T60_NAME, _, WA_T60_ICON = GetSpellInfo(spellId)\n    end\n    \n    --check for Mass Entangle\n    name, _, spellId = select(4, GetTalentInfo(4,2,1))\n    \n    if name then\n        WA_PLAYER_TALENTS_MASSENTANGLEMENT = true\n        WA_PLAYER_TALENTS_60_SPELLID = spellId\n        WA_T60_NAME, _, WA_T60_ICON = GetSpellInfo(spellId)\n    end\n    \n    --check for Typhoon\n    name, _, spellId = select(4, GetTalentInfo(4,3,1))\n    \n    if name then\n        WA_PLAYER_TALENTS_TYPHOON = true\n        WA_PLAYER_TALENTS_60_SPELLID = spellId\n        WA_T60_NAME, _, WA_T60_ICON = GetSpellInfo(spellId)\n    end\nend\n\nfunction WA_F_NilNumber(value, alt)\n    \n    if value ~= nil then\n        return value\n    else\n        return alt\n    end\n    \n    \nend\n\nfunction WA_DB_AurasChanged()\n    \n    local name,_,_,count,_, duration, expires, source  = nil\n    \n    if WA_PLAYER_TALENTS_INCARNATION then\n        \n        name,_,_,count,_, duration, expires, source = UnitAura(\"player\",\"Incarnation: Chosen of Elune\")\n    else\n        \n        name,_,_,count,_, duration, expires, source = UnitAura(\"player\",\"Celestial Alignment\")\n    end\n    \n    WA_SPELLS_CELESTIAL_EXPIRES = (expires or 0)\n    WA_SPELLS_CELESTIAL_DURATION = (duration or 0)\n    \n    --legendary items\n    if WA_PLAYER_EQUIP_TED == true then\n        name,_,_,count,_, duration, expires, source = UnitAura(\"player\",\"The Emerald Dreamcatcher\")\n        \n        WA_PLAYER_AURAS_TEDEXPIRES = (expires or 0)\n        WA_PLAYER_AURAS_TEDDURATION = (duration or 0)\n        WA_PLAYER_AURAS_TEDSTACKS = (count or 0)\n    end\n    \nend\n\naura_env.WA_DB_Init = function()\n    --194223 (Celestial Alignment)\n    local name, _, spellId = nil\n    \n    WA_SPELLS_CELESTIAL_ID = 194223\n    WA_SPELLS_CELESTIAL_NAME, _, WA_SPELLS_CELESTIAL_ICON = GetSpellInfo(WA_SPELLS_CELESTIAL_ID)\n    \n    WA_SPELLS_INCARNATION_ID = 102560\n    WA_SPELLS_INCARNATION_NAME, _, WA_SPELLS_INCARNATION_ICON = GetSpellInfo(WA_SPELLS_INCARNATION_ID)\n    \n    aura_env.checkEquiptedItems()\n    WA_BD_CF_TalentChanges()\nend\n\nfunction WA_ChecksCountDOTS()\n    \n    local startSF = WA_PLAYER_TOTAL_SF\n    local startMF = WA_PLAYER_TOTAL_MF\n    local compTime = GetTime()\n    \n    WA_PLAYER_TOTAL_SF = 0\n    WA_PLAYER_TOTAL_MF = 0\n    \n    for i, v in pairs(WA_PLAYER_TARGETS) do\n        \n        WA_PLAYER_TOTAL_MF = WA_PLAYER_TOTAL_MF + WA_PLAYER_TARGETS[i].MF\n        WA_PLAYER_TOTAL_SF = WA_PLAYER_TOTAL_SF + WA_PLAYER_TARGETS[i].SF\n        \n        \n    end\n    \n    if startSF ~= WA_PLAYER_TOTAL_SF or startMF ~= WA_PLAYER_TOTAL_MF then\n        \n        WeakAuras.ScanEvents(\"WA_DRUIDSUNMOONDOTS\", WA_PLAYER_TOTAL_SF, WA_PLAYER_TOTAL_MF)\n        \n    end\nend\n\nfunction WA_TrackersCreateTarget(targetGuid)\n    \n    if not WA_PLAYER_TARGETS[targetGuid] or WA_PLAYER_TARGETS[targetGuid] == nil then\n        \n        WA_PLAYER_TARGETS[targetGuid] = { MF = 0, SF = 0, Update = nil, Start = nil  }\n    end\n    \n    return WA_PLAYER_TARGETS[targetGuid]\nend\n\naura_env.checkEquiptedItems = function()\n    \n    WA_PLAYER_EQUIP_TED = IsEquippedItem(137062);\n    WA_PLAYER_EQUIP_ONETHS = IsEquippedItem(137092);\n    \nend\n\n\n--call the talent checker, incase of reload-ui!\naura_env.WA_DB_Init();",
