				["custom"] = "function()\n    \n    local cTime = GetTime()\n    \n    WA_TIMERS_HEARTBEAT = WA_TIMERS_HEARTBEAT or (GetTime()+WA_HEARTBEAT)\n    \n    if cTime >= WA_TIMERS_HEARTBEAT then\n        WA_TIMERS_HEARTBEAT = (GetTime() + WA_HEARTBEAT)\n        \n        WeakAuras.ScanEvents(\"WA_HEARTBEAT\", cTime)\n        \n    end\n    \n    local lastCount = 0\n    local name,_,_,count,_, duration, expires, source = UnitAura(\"player\",\"Solar Empowerment\")\n    \n    lastCount = WS_SPELLS_SOLAREMPOWER\n    \n    if lastCount == nil then\n        lastCount = 0\n    end\n    \n    if count == nil then\n        count = 0\n    end\n    \n    if duration == nil then\n        duration = 0\n    end\n    \n    WS_SPELLS_SOLAREMPOWER = count\n    WS_SPELLS_SOLAREMPOWER_DURATION = duration\n    \n    if (count ~= lastCount) then\n        WeakAuras.ScanEvents(\"SOLAREMPOWER\", count, lastCount)\n    end\n    \n    name,_,_,count,_, duration, expires, source = UnitAura(\"player\",\"Lunar Empowerment\")\n    \n    lastCount = WS_SPELLS_LUNAREMPOWER\n    \n    if lastCount == nil then\n        lastCount = 0\n    end\n    \n    if count == nil then\n        count = 0\n    end\n    \n    if duration == nil then\n        duration = 0\n    end\n    \n    WS_SPELLS_LUNAREMPOWER = count\n    WS_SPELLS_LUNAREMPOWER_DURATION = duration\n    \n    if count ~= lastCount then\n        WeakAuras.ScanEvents(\"LUNAREMPOWER\", count, lastCount)\n    end\n    \n    if WA_PLAYER_HASTARGET then\n        \n        local name,_,_,_,_, duration, expires, source = UnitDebuff(\"target\",\"Moonfire\", nil, \"player\")\n        local inRange = false\n        local expiresAt = 0\n        \n        if WA_PLAYER_TARGET ~= nil then\n            inRange = IsSpellInRange(\"Moonfire\",\"target\")\n            \n            if inRange == nil then\n                inRange = nil\n            elseif inRange == 0 then\n                inRange = false\n            else\n                inRange = true\n            end\n            \n        end\n        \n        \n        if name ~= nil and source == \"player\" then\n            expiresAt = expires-GetTime()\n        else\n            expiresAt = -1\n        end\n        \n        if expiresAt <= 0 then\n            expiresAt = -1\n        end\n        \n        WA_SPELL_MOONFIRE_DURATION = WA_F_NilNumber(duration, -1)\n        WA_SPELL_MOONFIRE_EXPIRES = WA_F_NilNumber(expiresAt-1,expiresAt)\n        \n        --check for sunfire\n        name,_,_,_,_, duration, expires, source = UnitDebuff(\"target\",\"Sunfire\", nil, \"player\")\n        \n        if name ~= nil and source == \"player\" then\n            expiresAt = expires-GetTime()\n        else\n            expiresAt = -1\n        end\n        \n        if expiresAt <= 0 then\n            expiresAt = -1\n        end\n        \n        WA_SPELL_SUNFIRE_DURATION = WA_F_NilNumber(duration, -1)\n        WA_SPELL_SUNFIRE_EXPIRES = WA_F_NilNumber(expiresAt-1,expiresAt)\n        \n        --check for stellar falre (if selected)\n        if WA_PLAYER_TALENTS_STELLARFLARE then\n            \n            name,_,_,_,_, duration, expires, source = UnitDebuff(\"target\",\"Stellar Flare\", nil, \"player\")\n            \n            if name ~= nil and source == \"player\" then\n                expiresAt = expires-GetTime()\n            else\n                expiresAt = -1\n            end\n            \n            \n            WA_SPELL_STELLARFLARE_DURATION = WA_F_NilNumber(duration, -1)\n            WA_SPELL_STELLARFLARE_EXPIRES = WA_F_NilNumber(expiresAt-1,expiresAt)\n            \n        end\n        \n        WA_SPELL_INRANGE = inRange\n    end\n    \n    return true\nend",
