    WA_BUFFS[\"209406\"] = false\n            end\n            \n            WA_PLAYER_TARGETS[destGuid].Update = GetTime()\n            \n        end\n    end\n    \n    if fireWA_PROCHAGED == true then\n        \n        WeakAuras.ScanEvents(\"WA_PROCHAGED\")\n    end\n    \n    return false\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
