				["custom"] = "function( event, _, combatEvent, _, sourceGUID, _, _, _, _, destName, _, _, spellID, ... ) \n    if (combatEvent == \"SPELL_AURA_APPLIED\" or combatEvent == \"SPELL_AURA_REFRESH\") and sourceGUID == UnitGUID(\"player\") and spellID == 184073 then\n        last_mod_target_name = destName\n        return true\n    end\n    \n    if event == \"PLAYER_TARGET_CHANGED\" then\n        local _, _, _, _, _, mod_duration, mod_expires = UnitDebuff(\"target\", \"Mark of Doom\", nil, \"PLAYER\")\n        \n        if mod_expires ~= nil then\n            return true\n        end\n    end\nend",
