			["customText"] = "function()\n    --explode order :3,4,1,2\n    if aura_env.text then\n        local t = \"|TInterface\\\\TARGETINGFRAME\\\\UI-RaidTargetingIcon_%d.png:12|t\"\n        if aura_env.text == 1 then\n            t = t:format(3)\n            return t..\"|cffc000ffmelee left\"..t\n        elseif aura_env.text == 2 then\n            t = t:format(1)\n            return t..\"|cffffff00melee right\"..t\n        elseif aura_env.text == 3 then\n            t = t:format(7)\n            return t..\"|cffff0000range left\"..t\n        else --4\n            t = t:format(6)\n            return t..\"|cff0071ffrange right\"..t\n        end\n        \n        return '>>'..aura_env.text..'<<'\n    else\n        return '>>x<<'\n    end    \nend",
