				["custom"] = "function(WAevent,_,event,_,sourceGUID,_,_,_,destGUID,destName,_,_,spellID, spellName)\n    if WAevent == 'COMBAT_LOG_EVENT_UNFILTERED' then\n        if event and event == 'SPELL_CAST_SUCCESS' then\n            if spellID and spellID == 188514 then\n                C_Timer.After(0.3, function()\n                        WeakAuras.ScanEvents('iParagon_MarkOfTheLegions')\n                end)\n            end\n        elseif event and event == 'SPELL_AURA_APPLIED' then\n            if spellID and spellID == 187050 then\n                if not aura_env.time or (aura_env.time and GetTime() - aura_env.time > 2) then\n                    aura_env.time = GetTime()\n                    aura_env.marks = {}\n                end\n                if destGUID then\n                    table.insert(aura_env.marks, destGUID)\n                end\n                if destGUID and destGUID == UnitGUID('player') then\n                    local spots = {\n                        [1] = 3,\n                        [2] = 4,\n                        [3] = 1,\n                        [4] = 2,\n                    };\n                    aura_env.text = spots[#aura_env.marks]\n                    SendChatMessage(aura_env.text, 'yell')\n                end\n                local marks = {\n                    [1] = 7,\n                    [2] = 6,\n                    [3] = 3,\n                    [4] = 1,            \n                };\n                if UnitIsGroupLeader('player') and destName then\n                    SetRaidTarget(destName, marks[#aura_env.marks])\n                end\n            end\n        end\n    elseif WAevent == 'iParagon_MarkOfTheLegions' then\n        local legionTargets = {}\n        local soakers = 0\n        local player = UnitGUID('player')\n        local isLeader = false\n        \n        for i = 1, 20 do\n            local unitID = 'raid'..i\n            local isPlayer = false\n            if UnitGUID(unitID) == player then\n                isPlayer = true\n            end\n            local markName = GetSpellInfo(187050)\n            if UnitDebuff(unitID, markName) then\n            elseif UnitIsDeadOrGhost(unitID) then      \n            else\n                soakers = soakers + 1\n                if isPlayer then\n                    local soak = math.ceil(soakers/4)\n                    --SendChatMessage(soak)\n                    aura_env.text = soak\n                end\n            end\n        end\n        return true\n    end\nend",
