			["customText"] = "function()\n    if not SHACKLED or not next(SHACKLED) then return \"***\" end\n    \n    local out = {}\n    local pos = {}\n    \n    for i = 1, GetNumGroupMembers() do\n        local unit = UnitName(\"raid\" .. i)\n        pos[unit] = { UnitPosition(unit) }\n    end\n    \n    local function upos(u)\n        return pos[u][1], pos[u][2]\n    end\n    \n    local function dist(ax, ay, bx, by)\n        local dx, dy = ax - bx, ay - by\n        return (dx * dx + dy * dy) ^ 0.5\n    end\n    \n    local LINE = \"%s - %d - |cff%s%d|r - |cff%s%s|r\"\n    local px, py = UnitPosition(\"player\")\n    \n    for target, origin in pairs(SHACKLED) do\n        local d = dist(origin[1], origin[2], upos(target))\n        \n        local me = dist(px, py, origin[1], origin[2])\n        local me_color = (me < 25) and \"ff0000\" or \"00ff00\"\n        \n        local near = {}\n        local near_color = \"ff0000\"\n        \n        for u, _ in pairs(pos) do\n            if not UnitIsUnit(u, target)\n            and not UnitIsDeadOrGhost(u)\n            and dist(origin[1], origin[2], upos(u)) < 25 then\n                table.insert(near, u)\n            end\n        end\n        \n        if #near > 5 then\n            near = { \"5+\" }\n        end\n        \n        if #near < 1 then\n            near[1] = \"GJ TEAM\" \n            near_color = \"00ff00\"\n        end\n        \n        table.insert(out, LINE:format(\n                target,\n                math.floor(d),\n                me_color,\n                math.floor(me),\n                near_color,\n                table.concat(near, \", \")))\n    end\n    \n    return table.concat(out, \"\\n\")\nend",
