				["custom"] = "function()\n    slot13 = slot13\n    if slot13 == 0 then\n        return false\n    end\n    if a1 == nil then\n        return false\n    end\n    if a6 == \"RPPM\" then\n        if calcA == 100 then\n            return true\n        else\n            return false -- do not show this aura on RPPM trinkets\n        end\n    end\n    if a6 == \"PROC\" then\n        if procA == nil then procA = 0 end\n        local expire = a4 - GetTime()\n        expire = expire+procA\n        if expire <= 0 then expire = 0 end\n        if expire == 0 then\n            return true\n        else\n            return false\n        end\n    end\n    if a6 == \"BUFF\" then\n        \n        local buff = UnitBuff(\"player\", GetSpellInfo(a1), false, \"PLAYER\") or false\n        if procA == nil then procA = 0 end\n        local expire = a4 - GetTime()\n        expire = expire+procA\n        if expire <= 0 then expire = 0 end\n        if expire == 0 then\n            return true\n        else\n            return false\n        end\n    end\n    if a6 == \"DEBUFF\" then\n        local debuff = UnitDebuff(\"target\", GetSpellInfo(a1), false, \"PLAYER\") or false\n        if debuff then\n            return true\n        else\n            return false\n        end\n    end\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
