				["custom"] = "function ()\n    -- WA UseArtifactPower Trigger\n    -- We can't modify the button in combat so don't do anything\n    if InCombatLockdown() then return false end\n    local c\n    \n    -- loop through items and see if we have any in our bags\n    for id,v in pairs(aura_env.items) do\n        if v then\n            c = GetItemCount(id)\n            if c>0 then             \n                -- item found!\n                \n                -- set texture to match item's icon\n                local icon = GetItemIcon(id)\n                WeakAuras.regions[aura_env.id].region:SetTexture(icon)\n                \n                -- Make button clickable to use item                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                    \n                aura_env.button:Show()\n                aura_env.button:SetAttribute(\"type\", \"item\")\n                aura_env.button:SetAttribute(\"item\", \"item:\"..id)\n                \n                -- make the WA show up\n                return true\n            end\n        end                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                 \n    end                \n    \n    -- no items found, hide everything\n    WeakAuras.regions[aura_env.id].region:SetTexture(nil)\n    \n    aura_env.button:SetAttribute(\"type\", nil)\n    aura_env.button:SetAttribute(\"item\", nil)                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                            \n    aura_env.button:Hide()\n    \n    return false\n    \nend"